import React, { Component } from "react";
import "../App.css";
import Noi from "../immagini/chisiamo1.png";
import { Container, Row, Col, Button } from "react-bootstrap";

export default class notFound extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Chisiamo" style={{ paddingBottom: "3rem" }}>
        <Container>
          <Row>
            <Col sm>
              <h1 style={{ fontSize: "400px" }}>4</h1>
            </Col>
            <Col sm>
              <img
                src={Noi}
                alt="studenti"
                width="60%"
                className="imgChisiamo"
              />
            </Col>
            <Col sm>
              <h1 style={{ fontSize: "400px" }}>4</h1>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
